scriptlet.script:
//Script para eliminar las columnas que contengan cerosy pasar los FIID hijos a padres
var ent = scriptletInput.split("\n");
salida="";

for(i=0;i<ent.length;i++){
	emi=ent[i].split(",")[0];
	adq=ent[i].split(",")[1];
	cla=ent[i].split(",")[2];
	tipo=ent[i].split(",")[3];
	sum=ent[i].split(",")[4];

	if(cla==0 && tipo==0 && sum==0 ){
		salida+="";}
	else{
		salida+=emi+","+adq.replace(/D/,"B")+","+cla+","+tipo+","+sum+"\n";
	}
}

scriptletResult = salida;

//Script para eliminar las columnas que contengan cerosy pasar los FIID hijos a padres
var ent = scriptletInput.split("\n");
salida="";

for(i=0;i<ent.length;i++){
	emi=ent[i].split(",")[0];
	adq=ent[i].split(",")[1];
	ret=ent[i].split(",")[2];
	cons=ent[i].split(",")[3];
	nips=ent[i].split(",")[4];
	rech=ent[i].split(",")[5];

	if(ret==0 && cons==0 && nips==0 && rech==0 ){
		salida+="";}
	else{
		salida+=emi+","+adq.replace(/D/,"B")+","+ret+","+cons+","+nips+","+rech+"\n";
	}
}

scriptletResult = salida;

//Script para consolidar los FIID hijos con FIID padres
var ent = scriptletInput.split("\n");
salida="";

for(i=0;i<ent.length;i+2){
	ren1=ent[i];
	ren2=ent[i++];
	suma=ent[i]+","+ent[i++];
	op=suma.split(",");
	emi1=op[0];
	adq1=op[1];
	emi2=op[6];
	adq2=op[7];

	if((emi1 != emi2) && (adq1 != adq2)){
		salida+=ent[i]+"\n";break;	
	}else{
		ret1=parseInt(op[2]);
		cons1=parseInt(op[3]);
		nips1=parseInt(op[4]);
		rech1=parseInt(op[5]);
		ret2=parseInt(op[8]);
		cons2=parseInt(op[9]);
		nips2=parseInt(op[10]);
		rech2=parseInt(op[11]);

		//sumas
		ret=ret1+ret2;
		cons=cons1+cons2;
		nips=nips1+nips2;
		rech=rech1+rech2;
		salida+=emi1+","+adq1+","+ret+","+cons+","+nips+","+rech+"\n";	
	}
}

scriptletResult = salida;

