//Script para eliminar los reversos multiples (rev mul)
var ent = scriptletInput.split("\n");
var salida="";

for(i=0;i<ent.length;i++){
	emi=ent[i].split(",")[0];
	adq=ent[i].split(",")[1];
	tnx=ent[i].split(",")[2];
	ret=ent[i].split(",")[3];
	if(ret.search(/rev.*mul.*/ig)!=-1){// si lo encontro
		salida+="";
	}else{
		salida+=ent[i]+"\n";
	}
}
scriptletResult=salida;

